webpackJsonp([0x7c918458b317],{1339:function(t,e){t.exports={data:{site:{siteMetadata:{title:"女王控的博客",description:'前端工程师，黑猫女王控，欢迎勾搭，技术相关<a href="https://github.com/towavephone" target="_blank">@towavephone</a>，QQ闲聊<a href="tencent://AddContact/?fromId=45&fromSubId=1&subcmd=all&uin=634407147&website=www.oicqzone.com">@towave</a>，bili关注<a href="https://space.bilibili.com/11507708#/" target="_blank">@towave</a>',siteUrl:"https://blog.towavephone.com"}}},pathContext:{posts:[{excerpt:"问题 我们在启动应用的时候经常发现我们需要使用的端口被别的程序占用，但是我们又不知道是被谁占用，这时候我们需要找出“真凶”，如何做到呢？ 步骤 开始--->运行--->cmd，或者是 window+R 组合键，调出命令窗口 输入命令： ，列出所有端口的情况。在列表中我们观察被占用的端口，比如是 49157，首先找到它。 查看被占用端口对应的 PID，输入命令： ，回车，记下最后一位数字，即 PID,这里是 2720 继续输入 ，回车，查看是哪个进程或者程序占用了 272…",html:'<h2 id="问题"><a href="#%E9%97%AE%E9%A2%98" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>问题</h2>\n<p>我们在启动应用的时候经常发现我们需要使用的端口被别的程序占用，但是我们又不知道是被谁占用，这时候我们需要找出“真凶”，如何做到呢？</p>\n<h2 id="步骤"><a href="#%E6%AD%A5%E9%AA%A4" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>步骤</h2>\n<ol>\n<li>开始--->运行--->cmd，或者是 window+R 组合键，调出命令窗口</li>\n<li>输入命令：<code class="language-text">netstat -ano</code>，列出所有端口的情况。在列表中我们观察被占用的端口，比如是 49157，首先找到它。</li>\n<li>查看被占用端口对应的 PID，输入命令：<code class="language-text">netstat -aon|findstr &quot;49157&quot;</code>，回车，记下最后一位数字，即 PID,这里是 2720</li>\n<li>继续输入<code class="language-text">tasklist|findstr &quot;2720&quot;</code>，回车，查看是哪个进程或者程序占用了 2720 端口，结果是：svchost.exe</li>\n<li>或者是我们打开任务管理器，切换到进程选项卡，在 PID 一列查看 2720 对应的进程是谁，如果看不到 PID 这一列,如下图：</li>\n<li>则我们点击查看--->选择列，将 PID(进程标示符)前面的勾打上，点击确定。</li>\n<li>这样我们就看到了 PID 这一列标识，看一下 2720 对应的进程是谁，如果没有，我们把下面的显示所有用户的进程前面的勾打上，就可以看到了，映像名称是 svchost.exe，描述是，Windows 的主进程,与上面命令查看的完全一致。</li>\n<li>结束该进程：在任务管理器中选中该进程点击”结束进程“按钮，或者是在 cmd 的命令窗口中输入：<code class="language-text">taskkill /f /t /im Tencentdl.exe</code>。</li>\n</ol>',id:"/github/workspace/blog/windows端口占用/index.md absPath of file >>> MarkdownRemark",timeToRead:1,frontmatter:{date:"2017-12-07 09:55:47",path:"/windows-port/",tags:"系统, windows",title:"windows查看端口占用进程",draft:null}}],length:1,tag:"windows",pagesSum:1,page:1}}}});